class HeroModel {
	constructor(Id,X,Y,AttackPlayer){
		this.Id = Id;
		this.X=X;
		this.Y=Y;
		this.AttackPlayer=AttackPlayer;
		this.Time =0;
	};
	
}
export { HeroModel }
